import React from 'react';
import { useLocation } from 'react-router-dom';
import { BookedContainer, BookedWrapper } from './landing.styles';
import Titanic from '../../assets/Titanic.gif';

const LandingPage = () => {
	const location = useLocation();
	return (
		<div className="main">
			<BookedContainer>
				<BookedWrapper>
					<img src={Titanic} alt="Nice gif!" />
					<h2>Deine Buchung wurde bestätigt! ⚓</h2>
				</BookedWrapper>
			</BookedContainer>
		</div>
	);
};

export default LandingPage;
